import React from "react";

const Navbar = () => {
    return (
        <div style={{ height: '60px', background: '#1976d2', color: 'white', display: 'flex', alignItems: 'center', padding: '0 20px' }}>
            <h2>Admin Panel</h2>
        </div>
    );
};

export default Navbar;
